settings.colorFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var res = {
    url: images[0],
    size: 40
};

var state = dsData[dsIndex]['state'];

var imageMap = {
    'Waiting for Hen': images[0],
    'Hen Inside':      images[1],
    'Eggs Inside':     images[2],
    'Recolecting Eggs': images[3]
};

if (imageMap[state]) {
    res.url = imageMap[state];
}

return res;

labelColor.colorFunction:
var temperature = value;
